import '../App.css';
import React from "react";

function Home() {
    return (

        <div className={"App-header"}>
            <h2>Algothon 2021</h2>
            <h4>Welcome to our team website! Use the navigation bar to visualise our data</h4>
            <h6>Sponsorised by Aspect Capital</h6>
            <img src={process.env.PUBLIC_URL + "/Images/LogoAlgothon.png"} alt="logo"/>

        </div>





    );
}

export default Home;
